import React, { Component } from 'react';

//Material UI
import Grid from '@material-ui/core/Grid';

class insurance extends Component {
    render() {
        return (
            <div>
                <Grid container>
                    <Grid item sm={2} xs={12}>
                        <p>Hello</p>
                    </Grid>
                    <Grid item sm={2} xs={12}>
                        <p>Hello</p>
                    </Grid>
                </Grid>
            </div>
        )
    }
}

export default insurance
